import React from "react";

import heroImage from "../assets/heroimage.jpg";
import feature1Icon from "../assets/feature1-icon.jpg";
import feature2Icon from "../assets/feature2-icon.jpg";
import feature3Icon from "../assets/feature3-icon.jpg";
import testimonial1 from "../assets/testimonial1.png";
import testimonial2 from "../assets/testimonial2.png";
import testimonial3 from "../assets/testimonial3.png";

const HomePage = () => {
  return (
    <div className="bg-gray-50">
      {/* Hero Section */}
      <div
        className="relative w-full h-screen flex items-center justify-center text-center text-white"
        style={{
          backgroundImage: `url(${heroImage})`,
          backgroundSize: "cover",
          backgroundPosition: "center",
        }}
      >
        <div className="absolute inset-0 bg-black opacity-50"></div>
        <div className="relative z-10 px-6">
          <h1 className="text-5xl font-bold">Welcome to the Future of Learning</h1>
          <p className="text-xl text-gray-200 mt-4 mb-8">
            Join thousands of students and trainers in our interactive and engaging learning platform.
          </p>
          <div className="space-x-4">
            <button className="bg-white text-blue-600 px-8 py-3 rounded-lg font-semibold hover:bg-gray-100">
              Get Started
            </button>
            <button className="bg-transparent border-2 border-white text-white px-8 py-3 rounded-lg font-semibold hover:bg-white hover:text-blue-600">
              Learn More
            </button>
          </div>
        </div>
      </div>

      {/* Features Section */}
      <div className="container mx-auto px-6 py-16">
        <h2 className="text-3xl font-bold text-center text-gray-800 mb-12">Why Choose Us?</h2>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
          {[feature1Icon, feature2Icon, feature3Icon].map((icon, index) => (
            <div key={index} className="bg-white p-8 rounded-lg shadow-md text-center">
              <img src={icon} alt="Feature" className="w-16 h-16 mx-auto mb-4" />
              <h3 className="text-xl font-semibold text-gray-800 mb-4">
                {index === 0 ? "Expert Trainers" : index === 1 ? "Comprehensive Courses" : "Interactive Learning"}
              </h3>
              <p className="text-gray-600">
                {index === 0 ? "Learn from industry experts with years of experience." : index === 1 ? "Access a wide range of courses tailored to your needs." : "Engage with interactive content and hands-on projects."}
              </p>
            </div>
          ))}
        </div>
      </div>

      {/* Testimonials Section */}
      <div className="bg-gray-100 py-16">
        <div className="container mx-auto px-6">
          <h2 className="text-3xl font-bold text-center text-gray-800 mb-12">What Our Users Say</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
            {[testimonial1, testimonial2, testimonial3].map((testimonial, index) => (
              <div key={index} className="bg-white p-8 rounded-lg shadow-md">
                <p className="text-gray-600 mb-4">
                  {index === 0 ? "This platform has transformed the way I learn. The courses are well-structured and easy to follow." : index === 1 ? "As a trainer, I love how easy it is to create and manage courses on this platform." : "The interactive learning experience is unmatched. Highly recommend!"}
                </p>
                <div className="flex items-center">
                  <img src={testimonial} alt="User" className="w-12 h-12 rounded-full border-2 border-gray-300" />
                  <div className="ml-4">
                    <h4 className="text-lg font-semibold text-gray-800">
                      {index === 0 ? "Alice" : index === 1 ? "Bob" : "Charlie"}
                    </h4>
                    <p className="text-gray-600">{index === 0 ? "Student" : index === 1 ? "Trainer" : "Student"}</p>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* Footer */}
      <footer className="bg-gray-800 text-white py-8">
        <div className="container mx-auto px-6 text-center">
          <p className="text-gray-400">&copy; 2023 LMS. All rights reserved.</p>
          <div className="mt-4 space-x-4">
            <a href="#" className="text-gray-400 hover:text-white">Privacy Policy</a>
            <a href="#" className="text-gray-400 hover:text-white">Terms of Service</a>
          </div>
        </div>
      </footer>
    </div>
  );
};

export default HomePage;
